import React from 'react';
import './navbar.css';
import logo from '../../assets/logo.png';
import {link} from 'react-scroll';

const Navbar = () => {
    return(
       <nav className='navbar'>
        <img src={logo} alt="logo" className='logo'/>
        
        <div className='desktopMenu'>
          <link className='link.desktopMenuListItem'>Home</link>
          <link className='link.desktopMenuListItem'>About</link>
          <link className='link.desktopMenuListItem'>Portfolio</link>
          <link className='link.desktopMenuListItem'>Clients</link>

        </div>
       <button className='button.desktopMenuBtn'>
        <img src='' alt='' className='desktopMenuImg'/>Contact Me</button>
       </nav>
    );
}

export default Navbar
